{"_id":{"$oid":"5a739271c28ef7657412c431"},"messages":[{"_id":"42998","registrationDate":{"$date":"2018-02-01T22:17:17.000Z"},"text":"/start","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"43010","registrationDate":{"$date":"2018-02-01T22:20:23.000Z"},"text":"Вопрос: по тарифу light ребенок может провозить ручную кладь 10кг?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"43011","registrationDate":{"$date":"2018-02-01T22:21:59.000Z"},"text":"Точнее вопрос такой: я со своей семьей купил билеты по тарифу light. Нас 2 взрослых, 1 ребенок 3.5 года и один ребёнок 11 месяцев. Сколько багажа мы можем провозить с собой?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517546121831","operatorReply":{"date":{"$date":"2018-02-02T04:35:21.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Здравствуйте. Ручную кладь может провозить каждый пассажир по любому тарифу. В ручную кладь можно взять одну сумку до 10 кг и не больше 55*40*20 см ни по одной стороне. В отличие от багажа, размеры ручной клади не суммируются. Дополнительно к сумке можно взять с собой один из трёх предметов: портфель для деловых бумаг, дамскую сумку (размеры и вес любые) или рюкзак (40*25*20 см, до 5 кг). Ноутбук, фотоаппарат, планшет можно лишь в чем-то из перечисленного выше\nТакже можно взять бесплатно: букет цветов, верхнюю одежду, костюм в портпледе, необходимые в полете лекарства, запечатанный пакет товаров из Duty Free (не тяжелее 3 кг)\nПодробные правила перевозки ручной клади – https://www.utair.ru/information/transport-regulations/#perevozka-bagazha-i-ruchnoy-kladi","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"43029","registrationDate":{"$date":"2018-02-02T04:37:14.000Z"},"text":"Спасибо за информацию.","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"}],"rate":5,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
{"_id":{"$oid":"5a827057c28ef725f9e846ce"},"messages":[{"_id":"50329","registrationDate":{"$date":"2018-02-13T04:57:59.000Z"},"read":{"date":{"$date":"2018-02-13T04:58:12.571Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Я уже и так их добавила вручную,но мили не начислены до сих пор !","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518497902979","operatorReply":{"date":{"$date":"2018-02-13T04:58:22.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Когда добавляли?","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"50332","registrationDate":{"$date":"2018-02-13T04:59:01.000Z"},"read":{"date":{"$date":"2018-02-13T05:00:25.866Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Через неделю после полёта","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518498018504","operatorReply":{"date":{"$date":"2018-02-13T05:00:18.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Месяц прошел уже с добавления?","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"50334","registrationDate":{"$date":"2018-02-13T05:00:43.000Z"},"read":{"date":{"$date":"2018-02-13T05:03:07.224Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"attachments":[{"type":"image","guid":"a9eaec64-803a-4ca7-aa8c-4f51f41d90b7"}],"_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"50336","registrationDate":{"$date":"2018-02-13T05:00:50.000Z"},"read":{"date":{"$date":"2018-02-13T05:03:07.224Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Нет ещё","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518498200487","operatorReply":{"date":{"$date":"2018-02-13T05:03:20.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"А статус запросов какой? В обработке?","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"50342","registrationDate":{"$date":"2018-02-13T05:04:14.000Z"},"read":{"date":{"$date":"2018-02-13T05:06:47.243Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"А как это узнать ?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518498428038","operatorReply":{"date":{"$date":"2018-02-13T05:07:08.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Назовите, пожалуйста, номер карты «Статус», фамилию и имя владельца, а также номер телефона и адрес электронной почты, которые используются в качестве логина для входа.","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"50346","registrationDate":{"$date":"2018-02-13T05:08:39.000Z"},"read":{"date":{"$date":"2018-02-13T05:10:23.173Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Номер карты статус клиента,ФИО клиента, телефон клиента, электронная почта клиента","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518498667864","operatorReply":{"date":{"$date":"2018-02-13T05:11:07.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Пока не начислены, у вас только приветственные 300 миль","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"50350","registrationDate":{"$date":"2018-02-13T05:11:51.000Z"},"read":{"date":{"$date":"2018-02-13T05:12:39.996Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Да я знаю что не начислены,поэтому и спрашиваю","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518498777857","operatorReply":{"date":{"$date":"2018-02-13T05:12:57.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Напишите, пожалуйста, официальное обращение на стартовой странице сайта в разделе «Обратная связь» — https://www.utair.ru/information/feedback/ В выпадающем меню выберите вариант «Программа СТАТУС». Специалисты обстоятельно рассмотрят ваш вопрос и пришлют ответ на электронную почту.","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"50357","registrationDate":{"$date":"2018-02-13T05:13:34.000Z"},"text":"Хорошо,спасибо","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"}],"rate":5,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
