{"_id":{"$oid":"5a740c87c28ef7657412c446"},"messages":[{"_id":"43176","registrationDate":{"$date":"2018-02-02T07:00:22.000Z"},"text":"Интересует рейс UT 112 Самара - Сургут на 27 марта. На сайте в расписании данного рейса нет. Когда появится?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"43183","registrationDate":{"$date":"2018-02-02T07:06:31.000Z"},"attachments":[{"type":"image","guid":"2e572b05-876d-4d70-80ae-6d562762b5ee"}],"_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517555493727","operatorReply":{"date":{"$date":"2018-02-02T07:11:33.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d5"}},"text":"Здравствуйте. Данный рейс заведен до 24 марта. Далее начинается период летней навигации, по нему пока рейсы не заведены. Рекомендуем проверять позднее, к середине-концу февраля","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"}],"rate":4,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
{"_id":{"$oid":"5a740167c28ef7657412c43d"},"messages":[{"_id":"43063","registrationDate":{"$date":"2018-02-02T06:12:27.000Z"},"text":"/start","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"43077","registrationDate":{"$date":"2018-02-02T06:13:58.000Z"},"text":"На каких тарифах можно провести чехол со сноубордическим оборудованием в Сочи","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"43126","registrationDate":{"$date":"2018-02-02T06:33:50.000Z"},"text":"так себе у вас чатик","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517553380880","operatorReply":{"date":{"$date":"2018-02-02T06:36:20.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d5"}},"text":"Здравствуйте. Бесплатный провоз спортинвентаря напрямую зависит от выбранного тарифа. Билет, оформленный по тарифу «Лайт», не включает в себя эту услугу. Данный тариф максимально сковывает путешествие – багаж и спортинвентарь в него не включены, обмену на другую дату тариф также не подлежит. По нему можно взять лишь одно место ручной клади в салон (10 кг и 55*40*20 см). Стоимость одного места спортинвентаря или багажа составит 2500 рублей.\nМы рекомендуем приобретать билет по тарифу «Стандарт». В него включено одно место ручной клади, одно место багажа (23 кг и 203 см по сумме длины, ширины и высоты) и спортинвентарь: лыжи с парой палок, ботинками и шлемом в чехлах; сноуборд с ботинками и шлемом в чехлах или велосипед, в собранном состоянии упакованный в коробку. По стоимости, как правило, получается выгоднее, чем оформлять багаж или спортинвентарь по «Лайту». Также тариф «Стандарт» допускает добровольный обмен на другую дату, если у вас не получается лететь по какой-то причине.\nПодробные правила перевозки багажа – https://www.utair.ru/information/transport-regulations/#perevozka-bagazha-i-ruchnoy-kladi\n","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"}],"rate":4,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
{"_id":{"$oid":"5a740529c28ef7657412c443"},"messages":[{"_id":"43115","registrationDate":{"$date":"2018-02-02T06:28:39.000Z"},"text":"????","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"43119","registrationDate":{"$date":"2018-02-02T06:29:41.000Z"},"text":"Да неужели? А вчера чего не передал?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"43121","registrationDate":{"$date":"2018-02-02T06:29:57.000Z"},"text":"Напоминаю: Купил билет на рейс UT394/310318 который планировался к вылету на 19:55. Бронь №Брони клиента\nПолучил уведомление о переносе времени вылета на 04:35 утра, что меня категорически не устраивает. Мне нужен вылет на вечер 31 марта. Скажите, как можно обменять билет на нужное МНЕ время","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517553352314","operatorReply":{"date":{"$date":"2018-02-02T06:35:52.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d5"}},"text":"Здравствуйте. В связи со сложившейся ситуацией вы можете бесплатно обменять билет на другую дату или вернуть за него деньги в полном объеме. \nЧтобы выполнить вынужденный обмен билета на другую дату, позвоните в наш контакт-центр по телефонам, указанным на сайте (8-800-234-00-88 – для участников программы лояльности «Статус», 8-809-595-33-77 – для всех остальных, этот номер платный). Если возможности позвонить нет, то обратитесь в авиакассу или к представителю Авиакомпании в аэропорту.\nДля возврата напишите официальное обращение по ссылке – https://www.utair.ru/information/feedback/, подраздел «Бронирование/Билеты». Опишите причину возврата, фамилию и имя пассажиров и данные рейса (номер рейса, время вылета, дату полёта). Деньги за билет будут возвращены в течение 20 рабочих дней на ту же карту, по которой оплачивали билет на сайте\n","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"}],"rate":3,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
{"_id":{"$oid":"5a7408e6c28ef7657412c445"},"messages":[{"_id":"43140","registrationDate":{"$date":"2018-02-02T06:43:53.000Z"},"text":"/start","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"43151","registrationDate":{"$date":"2018-02-02T06:46:25.000Z"},"text":"Добрый день","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517554321683","operatorReply":{"date":{"$date":"2018-02-02T06:52:01.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d5"}},"text":"Здравствуйте","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"43161","registrationDate":{"$date":"2018-02-02T06:53:02.000Z"},"text":"Я бы хотела отменить своё обращение № Обращения от 02.02.2018, так как оно повторное","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517554403149","operatorReply":{"date":{"$date":"2018-02-02T06:53:23.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d5"}},"text":"Спасибо, мы передадим специалистам","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"}],"rate":2,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
{"_id":{"$oid":"5a796ff4c28ef74bd9c4e064"},"messages":[{"_id":"44285","registrationDate":{"$date":"2018-02-06T09:05:14.000Z"},"read":{"date":{"$date":"2018-02-06T09:43:13.774Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"/start","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517910377243","operatorReply":{"date":{"$date":"2018-02-06T09:46:17.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Здравствуйте","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"44360","registrationDate":{"$date":"2018-02-06T09:49:11.000Z"},"read":{"date":{"$date":"2018-02-06T09:49:39.626Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Здравствуйте","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"}],"rate":1,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
{"_id":{"$oid":"5a7978dcc28ef74bd9c4e06e"},"messages":[{"_id":"44333","registrationDate":{"$date":"2018-02-06T09:42:03.000Z"},"read":{"date":{"$date":"2018-02-06T09:46:47.522Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"/start","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517910414341","operatorReply":{"date":{"$date":"2018-02-06T09:46:54.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Здравствуйте\n","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"1517910414534","operatorReply":{"date":{"$date":"2018-02-06T09:46:54.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Здравствуйте\n","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"1517910410751","operatorReply":{"date":{"$date":"2018-02-06T09:46:50.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Здравствуйте\n","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"44359","registrationDate":{"$date":"2018-02-06T09:47:44.000Z"},"read":{"date":{"$date":"2018-02-06T09:47:53.650Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"здравствуйте, был я бронировал билет и допустил ошибку в фамилии (лишние две буквы в конце \"ФИО с ошибкой\", правильно Корректное ФИО) хотел бы узнать как можно исправить данную ошибку. Рейс 549, код брони Код брони клиента","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517910574274","operatorReply":{"date":{"$date":"2018-02-06T09:49:34.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Оставьте в разделе «Обратная связь» официальное обращение на изменение личных данных по ссылке: https://www.utair.ru/information/feedback/\n\nТам выберите «Бронирование/Билеты» – «Изменение данных в билетах, оформленных на сайте Авиакомпании». И в сообщении уже укажите причину обращения, номер билета и те данные, которые необходимо внести в билет. Специалисты отдела внесут изменения за 1–3 рабочих дня и отправят новый билет вам на электронную почту.\n\nЕсли по какой-то причине нет возможности написать или ждать 3 дня, то рекомендуем обратиться в авиакассу (можно прямо в аэропорту), кассиры внесут изменения при вас и перевыпустят билет. В этом случае придется заплатить за услугу кассовый сбор, размер которого нам неизвестен.\n","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"44364","registrationDate":{"$date":"2018-02-06T09:52:45.000Z"},"read":{"date":{"$date":"2018-02-06T09:52:47.364Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"я оставил официальное обращение на сайте, написал письмо и приложил всю информацию, просто вылет завтра в 9.40 , можно ли как то поспособствовать внесению изменений сегодня","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517910792748","operatorReply":{"date":{"$date":"2018-02-06T09:53:12.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Ускорить процесс невозможно. Рекомендуем обратиться в авиакассу\n","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"}],"rate":3,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
{"_id":{"$oid":"5a797b07c28ef74bd9c4e072"},"messages":[{"_id":"44367","registrationDate":{"$date":"2018-02-06T09:52:53.000Z"},"read":{"date":{"$date":"2018-02-06T09:53:36.658Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"добрый день\nпо тарифу стандарт я могу провести ручную кладь до 10 кг +  рюкзак до 5 кг, не сдавая их в багаж, правильно?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517910842446","operatorReply":{"date":{"$date":"2018-02-06T09:54:02.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Здравствуйте. Совершенно верно. В ручную кладь можно взять одну сумку до 10 кг и не больше 55*40*20 см ни по одной стороне. В отличие от багажа, размеры ручной клади не суммируются. Дополнительно к сумке можно взять с собой один из трёх предметов: портфель для деловых бумаг, дамскую сумку (размеры и вес любые) или рюкзак (40*25*20 см, до 5 кг). Ноутбук, фотоаппарат, планшет можно лишь в чем-то из перечисленного выше.\n\nТакже можно взять бесплатно: букет цветов, верхнюю одежду, костюм в портпледе, необходимые в полете лекарства, запечатанный пакет товаров из Duty Free (не тяжелее 3 кг)\n\nПодробные правила перевозки ручной клади – https://www.utair.ru/information/transport-regulations/#perevozka-bagazha-i-ruchnoy-kladi\n\n","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"44384","registrationDate":{"$date":"2018-02-06T09:55:13.000Z"},"text":"спасибо","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"}],"rate":5,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
{"_id":{"$oid":"5a799ca7c28ef74bd9c4e08e"},"messages":[{"_id":"44509","registrationDate":{"$date":"2018-02-06T12:16:10.000Z"},"read":{"date":{"$date":"2018-02-06T17:37:31.433Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"/start","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"44518","registrationDate":{"$date":"2018-02-06T12:17:25.000Z"},"read":{"date":{"$date":"2018-02-06T17:37:31.433Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Я ошиблась в паспортных данных при покупке билета, надо их поправить","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517938666493","operatorReply":{"date":{"$date":"2018-02-06T17:37:46.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Здравствуйте! Напишите, пожалуйста, номер билета (13 цифр, начинается с 298) или номер брони (6 цифр/букв на латинице) и ФИО пассажира.","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"44799","registrationDate":{"$date":"2018-02-06T17:39:06.000Z"},"read":{"date":{"$date":"2018-02-06T17:39:09.170Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Номер билета ФИО клиента","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517938795268","operatorReply":{"date":{"$date":"2018-02-06T17:39:55.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Для корректировки данных Вам необходимо обратиться на наш сайт в раздел «Обратная связь», «официальное обращение». При этом нужно выбрать раздел «бронирование/билеты». Специалисты в течении 3-х рабочих дней откорректируют данные и отправят Вам новую маршрут-квитанцию на адрес электронной почты, указанный в брони.","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"44806","registrationDate":{"$date":"2018-02-06T17:40:35.000Z"},"read":{"date":{"$date":"2018-02-06T17:41:32.620Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"А зачем тогда сюда просили данные написать?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517938930663","operatorReply":{"date":{"$date":"2018-02-06T17:42:10.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"обратная связь - \"официальное обращение\", а не \"чат со специалистом\".","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"44816","registrationDate":{"$date":"2018-02-06T17:43:24.000Z"},"read":{"date":{"$date":"2018-02-06T18:07:07.919Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"5 минут вы меня попросили написать данные о полёте? Зачем, если все равно надо писать в другом месте?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517940466609","operatorReply":{"date":{"$date":"2018-02-06T18:07:46.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"для того, чтобы посмотреть, где вы оформили билет)","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"}],"rate":3,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
{"_id":{"$oid":"5a79a667c28ef74bd9c4e099"},"messages":[{"_id":"44552","registrationDate":{"$date":"2018-02-06T12:58:02.000Z"},"read":{"date":{"$date":"2018-02-06T13:23:49.765Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"/start","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"44557","registrationDate":{"$date":"2018-02-06T13:00:03.000Z"},"read":{"date":{"$date":"2018-02-06T13:23:49.765Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Захожу в свою учётку а там мой товарищ а я попутчик и не могу это исправить что делать","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517923600139","operatorReply":{"date":{"$date":"2018-02-06T13:26:40.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Добрый день, необходимо оформить заявку на корректировку данных в профиле участника Статус, на сайте в разделе Обратная связь, выбираете Официальное обращение.","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"44620","registrationDate":{"$date":"2018-02-06T13:54:52.000Z"},"read":{"date":{"$date":"2018-02-06T14:07:03.898Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"И что там выбирать???","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1517926058850","operatorReply":{"date":{"$date":"2018-02-06T14:07:38.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Программа Статус-Изменение персональных данных.","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"}],"rate":4,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
