{"_id":{"$oid":"5a841ff1c28ef725f9e84745"},"messages":[{"_id":"51329","registrationDate":{"$date":"2018-02-14T11:39:29.000Z"},"read":{"date":{"$date":"2018-02-14T11:39:58.418Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Добрый день, а можно билет переписать на другого человека","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518608414465","operatorReply":{"date":{"$date":"2018-02-14T11:40:14.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Здравствуйте. Нет, переоформление билета на другого пассажира не допускается","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"51345","registrationDate":{"$date":"2018-02-14T11:44:14.000Z"},"read":{"date":{"$date":"2018-02-14T11:45:17.578Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"attachments":[{"type":"audio","guid":"db0b63ba-c046-44bf-b11e-492e63aaa6b2"}],"_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518608777132","operatorReply":{"date":{"$date":"2018-02-14T11:46:17.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Уточните вопрос текстом, пожалуйста. У нас нет возможности прослушивать аудиозаписи","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"51361","registrationDate":{"$date":"2018-02-14T11:50:01.000Z"},"read":{"date":{"$date":"2018-02-14T11:52:44.177Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Мы командой летим на фестиваль, а одна девочка не сможет полететь в связи с сложной ситуацией дома. Мы хотим поменять/или купить другой билет. Важно, что бы время было одно и тоже.","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518609179284","operatorReply":{"date":{"$date":"2018-02-14T11:52:59.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Назовите, пожалуйста, номер билета (тринадцать цифр, начинается с 298), номер брони (шесть цифр и/или букв латиницей) и фамилию пассажира","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"51373","registrationDate":{"$date":"2018-02-14T11:53:24.000Z"},"read":{"date":{"$date":"2018-02-14T11:54:25.200Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"ФИО клиента:\n Номер билета","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"51375","registrationDate":{"$date":"2018-02-14T11:53:44.000Z"},"read":{"date":{"$date":"2018-02-14T11:54:25.200Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"ФИО клиента:\nitinerary_TXOUMR-1","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"51377","registrationDate":{"$date":"2018-02-14T11:54:10.000Z"},"read":{"date":{"$date":"2018-02-14T11:54:25.200Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Пассажир-ФИО клиента","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518609407062","operatorReply":{"date":{"$date":"2018-02-14T11:56:47.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Билет оформлен по тарифу \"Лайт\", его вообще никак не изменить и не вернуть","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"51400","registrationDate":{"$date":"2018-02-14T12:04:39.000Z"},"read":{"date":{"$date":"2018-02-14T12:04:47.755Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"А есть билет на те же рейсы?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518609992186","operatorReply":{"date":{"$date":"2018-02-14T12:06:32.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Да, места есть","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"51406","registrationDate":{"$date":"2018-02-14T12:06:52.000Z"},"read":{"date":{"$date":"2018-02-14T12:12:05.405Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"А стоимость?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518610342307","operatorReply":{"date":{"$date":"2018-02-14T12:12:22.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Стоимость вы можете уточнить на нашем сайте, она может измениться в любой момент","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"}],"rate":5,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
{"_id":{"$oid":"5a856e97c28ef725f9e84795"},"messages":[{"_id":"51966","registrationDate":{"$date":"2018-02-15T11:27:19.000Z"},"read":{"date":{"$date":"2018-02-15T11:31:09.460Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Добрый день. Подскажите, с каким багажом я могу лететь? Какой вес и какие габариты?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"51968","registrationDate":{"$date":"2018-02-15T11:27:38.000Z"},"read":{"date":{"$date":"2018-02-15T11:31:09.460Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Номер билета","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"51970","registrationDate":{"$date":"2018-02-15T11:28:28.000Z"},"read":{"date":{"$date":"2018-02-15T11:31:09.460Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Номер брони","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518694358895","operatorReply":{"date":{"$date":"2018-02-15T11:32:38.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"В билет, оформленный по тарифу «Лайт», бесплатный багаж не входит, только ручная кладь. В ручную кладь можно взять одну сумку до 10 кг и не превышающую размер 55*40*20 см ни по одной величине. В отличие от багажа, параметры ручной клади не суммируются. Дополнительно к сумке можно взять с собой один из трёх предметов: портфель для деловых бумаг, дамскую сумку (размеры и вес любые) или рюкзак (40*25*20 см, до 5 кг).\n\nЕсли требуется место багажа, то его можно приобрести дополнительно (23 кг и 203 см по сумме длины, ширины и высоты – 2500 рублей за один участок маршрута или 50 евро при международных полетах). Оформить можно на стойке регистрации в аэропорту, в любой авиакассе или на нашем сайте при онлайн-регистрации за 36 часов до вылета по ссылке https://ticket.utair.ru/check-in/?switch_site=1\n\nПодробные правила перевозки багажа – https://www.utair.ru/information/transport-regulations/#perevozka-bagazha-i-ruchnoy-kladi\n","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"}],"rate":1,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
