{"_id":{"$oid":"5a7d4824c28ef725f9e8453c"},"messages":[{"_id":"47268","registrationDate":{"$date":"2018-02-09T07:04:18.000Z"},"read":{"date":{"$date":"2018-02-09T07:06:17.080Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Добрый день. Я приобрела билеты на рейс с пересадкой по России. При покупке билета указала данные загран паспортов","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"47274","registrationDate":{"$date":"2018-02-09T07:05:11.000Z"},"read":{"date":{"$date":"2018-02-09T07:06:17.080Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Сейчас выяснилось, что мне нужно обязательно брать паспорт РФ и Св-во о рождении для ребенка","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"47275","registrationDate":{"$date":"2018-02-09T07:06:06.000Z"},"read":{"date":{"$date":"2018-02-09T07:06:17.080Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Лишние документы брать не хотелось бы. Могу ли я поменять данные заграна на данные паспорта РФ и св-ва о рождении для ребенка?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518160004664","operatorReply":{"date":{"$date":"2018-02-09T07:06:44.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Здравствуйте. Назовите, пожалуйста, номер билета (тринадцать цифр, начинается с 298), номер брони (шесть цифр и/или букв латиницей) и фамилию пассажира","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"47277","registrationDate":{"$date":"2018-02-09T07:09:25.000Z"},"read":{"date":{"$date":"2018-02-09T07:13:29.671Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Минуту, пожалуйста","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"47278","registrationDate":{"$date":"2018-02-09T07:12:14.000Z"},"read":{"date":{"$date":"2018-02-09T07:13:29.671Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"номер билета","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"47279","registrationDate":{"$date":"2018-02-09T07:12:30.000Z"},"read":{"date":{"$date":"2018-02-09T07:13:29.671Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"номер брони","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"47280","registrationDate":{"$date":"2018-02-09T07:12:41.000Z"},"read":{"date":{"$date":"2018-02-09T07:13:29.671Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"2 пассажира с фамилией ФИО клиента","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"47281","registrationDate":{"$date":"2018-02-09T07:13:13.000Z"},"read":{"date":{"$date":"2018-02-09T07:13:29.671Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"обратный билет Номер билета","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518160406168","operatorReply":{"date":{"$date":"2018-02-09T07:13:26.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Оставьте в разделе «Обратная связь» официальное обращение на изменение личных данных по ссылке: https://www.utair.ru/information/feedback/\n\nТам выберите «Бронирование/Билеты» – «Изменение данных в билетах, оформленных на сайте Авиакомпании». И в сообщении уже укажите причину обращения, номер билета и те данные, которые необходимо внести в билет. Специалисты отдела внесут изменения за 1–3 рабочих дня и отправят новый билет вам на электронную почту.\n\nЕсли по какой-то причине нет возможности написать или ждать 3 дня, то рекомендуем обратиться в авиакассу (можно прямо в аэропорту), кассиры внесут изменения при вас и перевыпустят билет. В этом случае придется заплатить за услугу кассовый сбор, размер которого нам неизвестен.\n","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"47283","registrationDate":{"$date":"2018-02-09T07:15:30.000Z"},"read":{"date":{"$date":"2018-02-09T07:16:09.866Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"А если я обращусь через сайт для внесения изменений, то услуга платная?","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"},{"_id":"1518160563527","operatorReply":{"date":{"$date":"2018-02-09T07:16:03.000Z"},"operatorId":{"$oid":"5a71fba113851d07861ae9d4"}},"text":"Бесплатная","_class":"ru.utair.sd.mongo.model.user.message.OperatorMessage"},{"_id":"47285","registrationDate":{"$date":"2018-02-09T07:16:32.000Z"},"text":"Спасибо","_class":"ru.utair.sd.mongo.model.user.message.CustomerMessage"}],"rate":5,"category":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c0"},"name":"Старые тикеты","enable":True,"selectedTicketCategoryTypes":[{"_id":{"$oid":"5d147b2cef958f8f2b0379c1"},"name":"Прочее","enable":True,"selectedApplicationForm":"Вопрос","ticketCategoryIdentity":{"$numberLong":"10"}}],"identity":{"$numberLong":"10"}}]},
